import React, { Component } from "react";
import ReactDOM from "react-dom";
import { Input } from "react-bootstrap";
class Search extends Component {
  state = {};
  render() {
    function handleKeyPress(target) {
      if (target.charCode == 13) {
        alert("Enter clicked!!!");
      }
    }
    return (
      <React.Fragment>
        <input type="text" onKeyPress={this.handleKeyPress} />
        <form id="form" onsubmit="">
          <p>
            <i>
              {" "}
              <input
                type="text"
                className="input"
                placeholder="Class"
                id="classInput"
              />
            </i>
            <i>
              <input
                type="text"
                className="input"
                placeholder="Search..."
                id="searchInput"
              />{" "}
            </i>
          </p>
          <input type="submit" onclick="cname();" />
        </form>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert("dscdscdscdscs");
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
